import '@progress/kendo-theme-default/dist/all.css';
import React, { Component } from 'react';
import './style.css';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import Btn from './mui_button';
import Inp from './mui_input';
import GetData from './getdata';

var bookmark_test = [
    {
        name: 'Hello',
        link: 'creepyfuck.tech/react'
    },
    {
        name: 'Hello',
        link: 'creepyfuck.tech/react'
    },
]

class App extends Component {
    constructor() {
        super();
        this._bm_name = ''
        this._bm_val = ''
        this._downlaod = this._downlaod.bind(this);

        this.state.list = bookmark_test

        this.get_list()
    }

    _get_list() {

    }

    _changed_name = (state) => {
        this._bm_name = (state.target.value);
    }

    _changed_val = (state) => {
        this._bm_val = (state.target.value);
    }

    _add() {
        var data = {
            name: this._bm_name,
            link: this._bm_val,
        }

        fetch('http://localhost:4545/react/addbookmark', {
            method: 'POST',
            body: data
        })
            .then(response => response.json())
            .then(data => {
                console.log('Success:', data);
            })
            .catch((error) => {
                console.error('Error:', error);
            });
    }

    render() {
        return (
            <div>
                {/* <img src='/comic.png' height='100px' /> */}
                <div className="side-padding-20">
                    <Inp
                        _onChange={this._changed_name}
                        lable={'Name'}
                    />
                    <Inp
                        _onChange={this._changed_val}
                    />
                    <Btn
                        _onClick={this._add}
                        _text={'Add'}
                    />
                    <List>
                        {this.state.list.map((bookmark) => (
                            <ListItem button onClick={() => handleListItemClick(bookmark)} key={bookmark}>
                                <ListItemText primary={bookmark.name} secodary={bookmark.link}/>
                            </ListItem>
                        ))}
                    </List>
                </div>

                <br />
            </div>
        );
    }
}

export default App
